import React from 'react';
import Detail from './component/DetailPokemon/DetailPokemon';
import './app.css'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Login from './component/Login/Login';
import ShowPokemon from './component/ShowPokemon/ShowPokemon';
import Header from './component/Layouts/HomeLayout';
function App() {
  return (
    <Router>
    <Header></Header>
    <Switch>
        <Route path='/pokemon/:id' exact >
          <Detail/>
        </Route>
        <Route
              path="/"
              exact
              render={props => 
                <Showfilm {...props}  data='star'   />
              }
            />
        <Route path='/' exact >
          <ShowPokemon/>
        </Route>
        <Route path='/login' exact>
          <Login/>
        </Route>
      </Switch>
    </Router>
  )
}

export default App;
